*/

// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Box from '@mui/material/Box';
// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import {useState} from 'react';
import DataTable from "examples/Tables/DataTable";

// Data
import StaffData  from "layouts/StaffEntry/StaffEntry";
import MDButton from "components/MDButton";
//modal
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import TextField from '@mui/material/TextField';
import { Autocomplete } from "@mui/material";
function StaffEntry() {
  const [name,setName]=useState("");
  const [id,setId]=useState("");
  const [number, setNumber]=useState("");
  const [email,setEmail]=useState("");
  const [DOJ,setDOJ]=useState("");
  const [domain,setDomain]=useState("");
  const [department,setDepartment]=useState("");
  const { columns, rows } = StaffData();
  const [open, setOpen] = useState(false);
  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const Department=[
    {label:"Computer science and engineering",value:"cse"},
    {label:"Information Technology",value:"IT"},
    {label:"Artificial Intelligence and Machine Learning",value:"AIML"},
    {label:"Artificial Intelligence and Data Science",value:"AIDS"},
    {label:"Civil engineering",value:"Civil"},
    {label:"Electronics communications and Engineering",value:"ECE"},
    {label:"Electronical and Electronics Engineering",value:"EEE"},
    {label:"Mechanical Engineering",value:"MECH"},
    {label:"Computer Science and Buisness Systems",value:"CSBS"},
    {label:"Master of Buisness Administration",value:"MBA"},
    {label:"Master of Computer Administration",value:"MCA"}
  ];
  const Year=[
    {label:"I",value:"I"},
    {label:"II",value:"II"},
    {label:"III",value:"III"},
    {label:"IV",value:"IV"}
  ]
  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox pt={6} pb={3}>
        <Grid container spacing={6}>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
                display="flex"
                justifyContent="space-between" // To space elements evenly
                alignItems="center" // Align items vertically
              >
                <MDTypography variant="h6" color="white">
                  Staff Info
                </MDTypography>
                <MDButton color="success" onClick={handleOpen}>
                  ADD Staff
                </MDButton>
              </MDBox>
              <MDBox pt={3}>
                <DataTable
                  table={{ columns, rows }}
                  isSorted={false}
                  entriesPerPage={false}
                  showTotalEntries={false}
                  noEndBorder
                />
              </MDBox>
              <Dialog maxWidth="lg" open={open} onClose={handleClose}>
                <DialogTitle>Staff Entry</DialogTitle>
                <DialogContent>
                  <DialogContentText>
                        <Box
                                component="form"
                                sx={{
                                  '& .MuiTextField-root': { m: 2, width: '100ch' },
                                }}
                                noValidate
                                autoComplete="off"
                              >
                            <div>
                                <TextField
                                  required
                                  id="outlined-required"
                                  label="Name"
                                  placeholder="Name"
                                  value={name}
                              onChange={(e) =>
                                setName(e.target.value)
                              }
                                /><br></br>
                                <TextField
                                  required
                                  id="outlined-required"
                                  label="Staff ID"
                                  value={id}
                              onChange={(e) =>
                                setId(e.target.value)
                              }
                                />
                                <Autocomplete
                                id="combo-box-demo"
                                options={Department}
                                sx={{ width: 300 }}
                                value={department}
                              onChange={(e) =>
                                setDepartment(e.target.value)
                              }
                                renderInput={(params) => <TextField {...params} label="Department" />}
                                />
                                 <TextField
                                  required
                                  id="outlined-required"
                                  label="contact Number"
                                  value={number}
                                  onChange={(e) =>
                                    setNumber(e.target.value)
                                  }
                                />
                                 <TextField
                                  required
                                  id="outlined-required"
                                  label="staff email"
                                  value={email}
                                  onChange={(e) =>
                                    setEmail(e.target.value)
                                  }
                                />
                                 <TextField
                                  required
                                  id="outlined-required"
                                  type="date"
                                  label="Date of Joining"
                                  value={DOJ}
                                  onChange={(e) =>
                                    setDOJ(e.target.value)
                                  }
                                />
                                 <TextField
                                  required
                                  id="outlined-required"
                                  label="Domain name"
                                  value={domain}
                                  onChange={(e) =>
                                    setD(e.target.value)
                                  }
                                />


                                <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                            </div>
                          </Box>
                  </DialogContentText>
                </DialogContent>
                <DialogActions>
                  <MDButton onClick={handleClose} color="primary">
                    Cancel
                  </MDButton>
                  <MDButton onClick={handleClose} color="primary" autoFocus>
                    Save
                  </MDButton>
                </DialogActions>
              </Dialog>
            </Card>

          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default StaffEntry;
